        // Function to populate scores in the table
       // Function to populate scores in the table
    function populateScores() {
        const tbody = document.getElementById("scoreTableBody");
        tbody.innerHTML = ""; // Clear previous entries

        // Initialize an array to hold team scores and FPTS for each week
        const teamScores = fantasy_team_submissions.map(team => {
            // Initialize the score object for this team
            let totalScores = {
                name: team.name,
                week1: 0,
                week2: 0,
                week3: 0,
                week4: 0,
                week5: 0,
                week6: 0,
                total: 0
            };
            const teamSelections = Object.values(team);
            const players = teamSelections.filter((_, index) => index !== 0 && index !== teamSelections.length - 1);
            // Loop through each player in the team's roster
            for (const player of players) {
                
                // Fetch the player's stats from playerStats using the player's name
                for (let week = 1; week <= 6; week++) {
                    const weekKey = `week ${week}`;
                    if (player_stats[player] && player_stats[player][weekKey]) {
                        // Accumulate FPTS for each week
                        const fpts = player_stats[player][weekKey][" FPTS"];
                        console.log(fpts);

                        totalScores[`week${week}`] += fpts || 0;  // Ensure FPTS is a number
                    }
                }
            }
            
            // Calculate the grand total for the team
            totalScores.total = totalScores.week1 + totalScores.week2 + totalScores.week3 +
                                totalScores.week4 + totalScores.week5 + totalScores.week6;
            for (const key in totalScores) {
            // Check if the key is not 'name' and the value is a number
            if (key !== 'name' && typeof totalScores[key] === 'number') {
                // Round the value to 1 decimal place
                totalScores[key] = parseFloat(totalScores[key].toFixed(1));
                }
            }
            return totalScores; // Return the scores object for this team
        });

        // Sort teams by total score (Descending)
        teamScores.sort((a, b) => b.total - a.total);

        // Add each team's scores to the table
        teamScores.forEach(teamScore => {
            const row = document.createElement("tr");
            row.innerHTML = `<td>${teamScore.name}</td>
                            <td>${teamScore.week1}</td>
                            <td>${teamScore.week2}</td>
                            <td>${teamScore.week3}</td>
                            <td>${teamScore.week4}</td>
                            <td>${teamScore.week5}</td>
                            <td>${teamScore.week6}</td>
                            <td>${teamScore.total}</td>`;
            tbody.appendChild(row);
        });
    }


        // Call the function to populate scores on page load
        window.onload = populateScores;
    </script>
